import React from 'react';

function TreeCounter({ count }) {
  return (
    <div className="tree-counter">
      <span style={{fontSize:'150px', fontWeight:'1000'}}>{count}</span>
      <h1 style={{fontSize:'70px', fontWeight:'1000'}}>Trees Planted</h1>
    </div>
  );
}

export default TreeCounter;
